import { DataGrid } from "@mui/x-data-grid";
import { studentColumns, studentRows } from "../Helpers/dataTableSource";

const DataTable = () => {
  return (
    <Container>
      <DataGrid
        rows={studentRows}
        columns={studentColumns}
        pageSize={5}
        rowsPerPageOptions={[5]}
        checkboxSelection
      />
    </Container>
  );
};

export default DataTable;

const Container = styled.main`
  height: 37.5rem;
  padding: 1.25rem;
`;
